import React, { Component } from 'react';
import { useNavigate } from "react-router-dom";

function App() {

  let navigate = useNavigate();
  const routeChange = () => {
    let path = `./QRCodeScanner`;
    navigate(path);
  }

  return (
    <div>
      <h1>Welcome to the landing page</h1>
      <button onClick={routeChange}>Scan QR</button>
    </div>
  );
}


export default App;
